import React from "react";
import Wrapper from "./WorkroomPage.style.js";
import colors from "../../components/colors";
import writing from "../../assets/imgs/writing.gif";

const WorkroomPage = () => {
  document.body.style = `background:${colors.purple}`;

  return (
    <Wrapper>
      <div className="container">
        <h2>The Work Room</h2>
        <br></br> <br></br> <br></br>
        <div className="row">
          <img src={writing}></img>
          <div className="box">All work and no play makes Jack a dull boy.</div>
        </div>
      </div>
    </Wrapper>
  );
};

export default WorkroomPage;
